function homeView() {
  return (
    <div>
      <img src="../public/logo512.png" width="40px" alt="site-logo" />
      <h1>My reactive site!</h1>
      <ul>
        <li>Stuff 1</li>
        <li>Stuff 2</li>
        <li>Stuff 3</li>
        <li>Stuff 4</li>
      </ul>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render( homeView());
